import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {LoginComponent} from "./mothercomponents/LoginComponent";

function App() {
  return (
      <BrowserRouter>
          <Routes>
              <Route path="/" element={<LoginComponent/>}></Route>
          </Routes>
      </BrowserRouter>
  );
}

export default App;
